import React from 'react';
import ReactModal from 'react-modal';
import { useState, useEffect } from 'react';

const Footer = () => {

    const [isModalOpen, setIsModalOpen] = useState(false);
    const [date, setDate] = useState();

    console.log('date', date);

    const openModal = () => {
        setIsModalOpen(true);
        console.log('ok')
    };

    const closeModal = () => {
        setIsModalOpen(false);
    };

    useEffect(() => {
        ReactModal.setAppElement('body');
    }, []);

    return (
        <div className="Footer">
            <div className="horaireGarage">
                <table>
                    <div>
                        <tr>
                            <td>Lun :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                        <tr>
                            <td>Mar :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                    </div>
                    <div>
                        <tr>
                            <td>Mer :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                        <tr>
                            <td>Jeu :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>

                    </div>
                    <div>
                        <tr>
                            <td>Ven :</td>
                            <td>08h45 - 12h00, 14h00 - 18h00</td>
                        </tr>
                        <tr>
                            <td>Sam :</td>
                            <td>08h45 - 12h00</td>
                        </tr>
                    </div>
                    <div>
                        <tr>
                            <td>Dim :</td>
                            <td>Fermé</td>
                        </tr>
                    </div>
                    <div>
                        <button onClick={openModal}>Je prends rendez-vous</button>
                    </div>
                </table>
            </div>
            {/*<span className="modalRdv" onClick={openModal}>Je prends rendez-vous</span>*/}
            <ReactModal
                isOpen={isModalOpen}
                onRequestClose={closeModal}
            >
                <form>
                    <legend>
                        Votre rendez-vous
                    </legend>
                    <h1>SELECTED DATE : {date}</h1>
                    <input type="text" name="nom" id="nom" placeholder="Votre nom"></input>
                    <label htmlFor="nom"></label>

                    <input type="text" name="prenom" id="prenom" placeholder="Votre prénom"></input>
                    <label htmlFor="prenom"></label>

                    <input type="email" name="email" id="email" placeholder="Votre email"></input>
                    <label htmlFor="email"></label>

                    <input type="tel" name="phone" id="phone" placeholder="Votre numéro de téléphone"></input>
                    <label htmlFor="phone"></label>

                    <input type="date" onChange={e => setDate(e.target.value)}></input>
                    <label htmlFor="date"></label>


                </form>

            </ReactModal>
        </div>
    );
};

export default Footer;
